import React, { useState } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  ScrollView,
  Alert
} from 'react-native';
import { useAuth } from '../../contexts/AuthContext';
import UserManagement from './UserManagement';
import AuthorApplications from './AuthorApplications';

const AdminPanel = () => {
  const { user, canManageUsers, canApproveAuthors } = useAuth();
  const [activeTab, setActiveTab] = useState('overview');

  if (!user || user.role !== 'admin') {
    return (
      <View style={styles.accessDenied}>
        <Text style={styles.accessDeniedText}>Bu sayfaya erişim yetkiniz bulunmamaktadır.</Text>
      </View>
    );
  }

  const renderTabContent = () => {
    switch (activeTab) {
      case 'users':
        return <UserManagement />;
      case 'applications':
        return <AuthorApplications />;
      case 'overview':
      default:
        return (
          <ScrollView style={styles.overviewContainer}>
            <View style={styles.welcomeSection}>
              <Text style={styles.welcomeTitle}>Hoş Geldiniz, {user.full_name}</Text>
              <Text style={styles.welcomeSubtitle}>
                AfetNet Admin Paneline hoş geldiniz. Buradan sistem yönetimi işlemlerini gerçekleştirebilirsiniz.
              </Text>
            </View>

            <View style={styles.statsGrid}>
              <View style={styles.statCard}>
                <Text style={styles.statNumber}>-</Text>
                <Text style={styles.statLabel}>Toplam Kullanıcı</Text>
              </View>
              <View style={styles.statCard}>
                <Text style={styles.statNumber}>-</Text>
                <Text style={styles.statLabel}>Aktif Yazarlar</Text>
              </View>
              <View style={styles.statCard}>
                <Text style={styles.statNumber}>-</Text>
                <Text style={styles.statLabel}>Bekleyen Başvurular</Text>
              </View>
              <View style={styles.statCard}>
                <Text style={styles.statNumber}>-</Text>
                <Text style={styles.statLabel}>Toplam Haber</Text>
              </View>
            </View>

            <View style={styles.quickActions}>
              <Text style={styles.sectionTitle}>Hızlı İşlemler</Text>

              {canManageUsers() && (
                <TouchableOpacity
                  style={styles.quickActionCard}
                  onPress={() => setActiveTab('users')}
                >
                  <Text style={styles.quickActionIcon}>👥</Text>
                  <View style={styles.quickActionContent}>
                    <Text style={styles.quickActionTitle}>Kullanıcı Yönetimi</Text>
                    <Text style={styles.quickActionDescription}>
                      Kullanıcıları görüntüleyin, rollerini değiştirin ve hesap durumlarını yönetin
                    </Text>
                  </View>
                  <Text style={styles.quickActionArrow}>→</Text>
                </TouchableOpacity>
              )}

              {canApproveAuthors() && (
                <TouchableOpacity
                  style={styles.quickActionCard}
                  onPress={() => setActiveTab('applications')}
                >
                  <Text style={styles.quickActionIcon}>📝</Text>
                  <View style={styles.quickActionContent}>
                    <Text style={styles.quickActionTitle}>Yazar Başvuruları</Text>
                    <Text style={styles.quickActionDescription}>
                      Bekleyen yazar başvurularını inceleyin ve onaylayın
                    </Text>
                  </View>
                  <Text style={styles.quickActionArrow}>→</Text>
                </TouchableOpacity>
              )}

              <TouchableOpacity
                style={styles.quickActionCard}
                onPress={() => Alert.alert('Bilgi', 'Bu özellik yakında eklenecektir')}
              >
                <Text style={styles.quickActionIcon}>📊</Text>
                <View style={styles.quickActionContent}>
                  <Text style={styles.quickActionTitle}>Sistem İstatistikleri</Text>
                  <Text style={styles.quickActionDescription}>
                    Detaylı sistem istatistiklerini ve raporları görüntüleyin
                  </Text>
                </View>
                <Text style={styles.quickActionArrow}>→</Text>
              </TouchableOpacity>

              <TouchableOpacity
                style={styles.quickActionCard}
                onPress={() => Alert.alert('Bilgi', 'Bu özellik yakında eklenecektir')}
              >
                <Text style={styles.quickActionIcon}>⚙️</Text>
                <View style={styles.quickActionContent}>
                  <Text style={styles.quickActionTitle}>Sistem Ayarları</Text>
                  <Text style={styles.quickActionDescription}>
                    Uygulama ayarlarını ve konfigürasyonları yönetin
                  </Text>
                </View>
                <Text style={styles.quickActionArrow}>→</Text>
              </TouchableOpacity>
            </View>

            <View style={styles.infoSection}>
              <Text style={styles.sectionTitle}>Yönetici Yetkileri</Text>
              <View style={styles.permissionsList}>
                <Text style={styles.permissionItem}>✓ Tüm kullanıcıları yönetme</Text>
                <Text style={styles.permissionItem}>✓ Yazar başvurularını onaylama</Text>
                <Text style={styles.permissionItem}>✓ Tüm haberleri düzenleme</Text>
                <Text style={styles.permissionItem}>✓ Yorumları moderasyon</Text>
                <Text style={styles.permissionItem}>✓ Sistem ayarlarını değiştirme</Text>
              </View>
            </View>
          </ScrollView>
        );
    }
  };

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.headerTitle}>Admin Paneli</Text>
        <View style={styles.tabContainer}>
          <TouchableOpacity
            style={[styles.tab, activeTab === 'overview' && styles.activeTab]}
            onPress={() => setActiveTab('overview')}
          >
            <Text style={[styles.tabText, activeTab === 'overview' && styles.activeTabText]}>
              Genel Bakış
            </Text>
          </TouchableOpacity>

          {canManageUsers() && (
            <TouchableOpacity
              style={[styles.tab, activeTab === 'users' && styles.activeTab]}
              onPress={() => setActiveTab('users')}
            >
              <Text style={[styles.tabText, activeTab === 'users' && styles.activeTabText]}>
                Kullanıcılar
              </Text>
            </TouchableOpacity>
          )}

          {canApproveAuthors() && (
            <TouchableOpacity
              style={[styles.tab, activeTab === 'applications' && styles.activeTab]}
              onPress={() => setActiveTab('applications')}
            >
              <Text style={[styles.tabText, activeTab === 'applications' && styles.activeTabText]}>
                Başvurular
              </Text>
            </TouchableOpacity>
          )}
        </View>
      </View>

      <View style={styles.content}>
        {renderTabContent()}
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f5f5'
  },
  accessDenied: {
